import Recommender from './Recommender';
import CaptainPicks from './CaptainPicks';
import Counter from './Counter';

function Home() {
    return (
        <div id="main">
            <div className="counter-and-cp-container">
                <Counter/>
                <CaptainPicks/>
            </div>
            <Recommender/>
        </div>
    )
};

export default Home;
